create table MOCK_DATA (
	id INT,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(50),
	gender VARCHAR(50),
	ip_address VARCHAR(20)
);

SELECT  id,
        first_name, 
        last_name,
        email,
        gender,
        ip_address
FROM    MOCK_DATA
--WHERE   email LIKE '__B%'; --3 rows
WHERE   first_name LIKE 'K%'; --3 rows

